import { ExpenseDate } from "./ExpenseDate";

const ExpenseItem=(props)=>{
    return <Card>
        <div className="main">
            <ExpenseDate date={props.prod.date} />
            <h2>{props.prod.title}</h2>
            <button>${props.prod.amount}</button>
        </div>
    </Card>;
}
export default ExpenseItem;
